import { useNavigate} from "react-router-dom";
import Contact from "./Contact";
function Home() {
    const navigate = useNavigate();
  return (
    <div className="Home">
        <h1>HOME PAGE</h1>
        <p onClick={()=>navigate("/contact")}>Contact</p>
    </div>
  );
}

export default Home;
